  padding: 1.5rem;
`;
const CompseWrapper = styled.div`
  background-color: red;
`;

export default function Sidebar() {
  return (
    <Wrapper>
      <CompseWrapper>
        <ComposeButton />
      </CompseWrapper>
    </Wrapper>
  );
}
